import { Matcher } from "../types";
/**
 * Matches the first satisfied matcher
 * @example
 * matchAny(matchRegex(/[Hh]ey!/), matchPrefixes("hi"))
 *
 * // Matching: "hey!"
 * // Matching: "hi"
 * // Matching: "Hey!"
 * // Not matching: "hello"
 * @category Matching
 */
export declare const matchAny: (...matchers: Matcher<{}, any, any>[]) => Matcher<{}, any, any>;
